import {Container } from "react-bootstrap";
import Galeria from "../components/Galeria";

const Home = () =>{
    return(
        <>
        <Container fluid>
            <Container className="my-2 text-center">
                <h1>NATURAL PIC</h1>
            </Container>
            <Galeria/>
        </Container>
        </>
    )
}
export default Home;
